const ShowEpisodes = (props) => {

    const [episodes, updateEpisodes] = useState(null);

    useEffect(() => {
        const updatedEpisodes = props.episodes.map(episode => {
        return <div>{episode.title}</div>
        });
        updateEpisodes(updateEpisodes);
    }, []);


    return (
        episodes ? episodes : null
